Configuration.html.body:
Configuration
Configuration file is read by UI application during startup - currently it's not possible to change it without restart.
The format of configuration is Typesafe Config.
The configuration files defines

settings of UI itself
settings of various services used by model
means of communicating with Apache Flink cluster

Sample configuration looks like this:
db {
  url: "jdbc:hsqldb:file:db/db;sql.syntax_ora=true"
  driver: "org.hsqldb.jdbc.JDBCDriver"
  user: "SA"
  password: ""
  connectionTimeout: 30000
}

categoriesConfig: {
  "FraudDetection": "streaming",
  "Recommendations": "streaming",
  "Default": "streaming"
}

usersFile: "./conf/users.conf"
environment: "demo"
attachmentsPath: "/tmp/touk/esp-frontend/attachments"

processTypes {
  streaming {
    engineConfig {    
      type: "flinkStreaming"
      restUrl: "http://localhost:8081"
      parallelism: 4
      jobManagerTimeout: 1m
    } 
    modelConfig {
      classPath: ["code-assembly.jar"]
      timeout: 10s
      checkpointConfig {
          checkpointInterval: 10m
          minPauseBetweenCheckpoints: 5m
          maxConcurrentCheckpoints: 1
          tolerableCheckpointFailureNumber: 6
      }
      restartInterval: "10s"
      kafka = {
        kafkaAddress = "kafka:9092"
      }
    }
  }
}


metricsSettings {
  url: "http://localhost:3000/dashboard/db/$dashboard?theme=dark&var-processName=$process&var-env=demo"
  defaultDashboard: "flink-esp"
  processingTypeToDashboard: {
    "request-response": "standalone",
    "streaming": "flink-esp"
  }
}

countsSettings {
  influxUrl: "http://localhost:3000/api/datasources/proxy/1/query"
  user: "admin"
  password: "admin"
}

Default configurations and overriding them
Default configuration for UI is in defaultUiConfig.conf.
We don't use reference.conf at the moment, as classloaders of model and ui are not separated, and we don't want UI config to be passed to model. 
Default configuration of models is taken from defaultModelConfig.conf files in model jar (see e.g. defaultModelConfig.conf).
You can also use reference.conf in model jars, however we found some problems with substitutions (see docs in ModelConfigToLoad).
How can you override default configuration? 
Detailed rules are described in documentation. For example, if in the model.conf we have following entries: 
{
   timeout: 10s
   restartInterval: 10s
   customProperties {
    property1: 11
   } 
}

you can override them in application.conf like this:
processTypes {
  type1 {
    modelConfig {
      timeout: 20s
      customProperties {
        property1: 13
      }
    }
  }
}

Please note that you have to define overridden properties in appropriate modelConfig section.
Overriding UI configuration is straightforward: 
  environmentAlert {
    content: "DEVELOPMENT ENVIRONMENT" 
  }

All configurations can also be overridden with environmental variables. Please consult TypesafeConfig documentation.
In particular, Nussknacker docker image is executed with -Dconfig.override_with_env_vars=trueFor example, to override samples above you would have to define:
```shell script
   CONFIG_FORCE_processTypes_type1_modelConfig_timeout=30s
   CONFIG_FORCE_environmentAlert_content="MY environment"  

##UI configuration

###Database

###Categories
Every process has to belong to a group called category. For example, in one Nussknacker installation you can 
have processes detecting frauds and those implementing marketing campaigns. Category configuration looks like this:
categoriesConfig: {
  "marketing": "streaming",
  "fraud": "streaming",
}
For each category you have to define its processing type (`streaming` in examples above). You can read about processing
types and their configurations below.

###Monitoring config
metricsSettings {
  url: "http://localhost:3000/dashboard/db/$dashboard?theme=dark&var-processName=$process&var-env=demo"
  defaultDashboard: "flink-esp"
  processingTypeToDashboard: {
    "request-response": "standalone",
    "streaming": "flink-esp"
  }
}

###Akka configuration

In `akka` section you can configure actor system used by GUI, e.g:
akka {
  http {
    server.parsing.max-content-length = 300000000 #300MB
  }
}

###Other configurations

* `usersFile` - location of file with user configuration
* `environment` - key of environment (used e.g. for alerts) - e.g. test or production
* `attachmentsPath` - location on disk where attachments will be stored

##Processing types 
One installation of Nussknacker can handle many different processing engines - currently the main supported engine is
Flink in streaming mode. Processing engines are defined in `processTypes` section. You can e.g. have two processing
types pointing to separate Flink clusters. Each processing engine has its name (e.g. `flinkStreaming`). 
Processing type configuration consists of two main parts:
* engine configuration
* model configuration

We describe them below

###Engine configuration
Configuration of communication with processing engine. Below we present Flink engine configuration as an example:
engingConfig {  type: "flinkStreaming"
  restUrl: "http://localhost:8081"
  parallelism: 4
  jobManagerTimeout: 1m
}
In this section you can put all configuration values for Flink client. We are using Flink REST API so the only
required parameter is `restUrl` - which defines location of Flink JobManager
* `jobManagerTimeout` (e.g. 1m) - timeout used in communication with Flink cluster

###Process  {#model}

Configuration of processes has few common keys:
*  `classPath` - list of files/URLs with jars with model for processes
*  `timeout` (e.g. 10s)- for synchronous services
*  `checkpointInterval` - deprecated (use `checkpointConfig.checkpointInterval` instead), e.g. 10m
*  `checkpointConfig` (more about checkpoint configuration you can find in [Flink Documentation](https://ci.apache.org/projects/flink/flink-docs-release-{{book.flinkMajorVersion}}/api/java/org/apache/flink/streaming/api/environment/CheckpointConfig.html) - only some options are available)
    * `checkpointInterval` - e.g. 10m
    * `minPauseBetweenCheckpoints` - optional, default to half of `checkpointInterval`, e.g. 5m
    * `maxConcurrentCheckpoints` - optional, default to 1, e.g. 4
    * `tolerableCheckpointFailureNumber` - optional, default 0, e.g. 6

If configuration does not contain `checkpointConfig`, `checkpointInterval` and process does not contain `checkpointInterval` in its properties then checkpoints are not enabled for process.

The rest of model configuration depends on your needs - all the properties defined here will be passed to ```ProcessConfigCreator``` as explained in [API](API.md) documentation.

###Configuration of services
In model configuration you can also define some attributes of services. These include:
* default values of fields
* icons
  nodes {
    containsDefaultValue {
      defaultValues {
        parameterName = "parameterValue"
      }
    },
    serviceWithDocumentation {
      docsUrl: "https://en.wikipedia.org/wiki/Customer_service"
    }
    hasSpecialIcon {
      icon: "icon_file.svg"
    }
  }
```

containsDefaultValue, hasSpecialIcon, serviceWithDocumentation - nodes names
parameterName - node parameter name you'd like to assign default value
parameterValue - value of default parameter
docsUrl - link to documentation (e.g. confluence page)
icon- path to icon file

Security.html.body:
Security
Nussknacker has pluggable security architecture - by default we support two type of authentication: BasicAuth and OAuth2.
You can either use default authentication provider, based on Basic authentication and static user configuration or integrate 
with other authentication mechanisms such as custom SSO implementation.
Users and permissions
Each user has id and set of permissions for every process category. There are following permissions:

Read - user can view processes in category
Write - user can modify/add new processes in category
Deploy - user can deploy or cancel processes in given category

Global permissions
In addition to permission system oriented around processes' categories we provide additional set of permissions.
This feature is designed to control access to components that have no category attached or it doesn't make sense for them to have one.
Currently supported permissions:

AdminTab - shows Admin tab in the UI (right now there are some useful things kept there including search components functionality).

BasicAuth security module
Configuration in following format:
authentication: {
  method: "BasicAuth"
  usersFile: "conf/users.conf"
}
Users file in following format:
users: [
  {
    identity: "user1"
    password: "pass",
    roles: ["Writer"]
  },
  {
    identity: "user2"
    encryptedPassword: "$2a$12$oA3U7DXkT5eFkyB8GbtKzuVqxUCU0zDmcueBYV218zO/JFQ9/bzY6"
    permissions: ["Deployer"]
  }
]

rules: [
  {
    role: "Reader"
    permissions: ["Read"]
    categories: ["Category1", "Category2"]
  },
  {
    role: "Writer"
    permissions: ["Read", "Write"]
    categories: ["Category1", "Category2"]
  },
  {
    role: "Deployer"
    permissions: ["Read", "Write", "Deploy"]
    globalPermissions: ["AdminTab"]
    categories: ["Category1", "Category2"]
  }
]
Encrypted hashes
Encryption of passwords uses BCrypt algorithm. You can generate sample hash using command:
python -c 'import bcrypt; print(bcrypt.hashpw("password".encode("utf8"), bcrypt.gensalt(rounds=12, prefix="2a")))'
Be aware that usage of BCrypt hashes will cause significant CPU overhead for processing of each http request, because we don't have sessions and all requests are authenticated.
To avoid this overhead you can configure cashing of hashes using configuration:
authentication: {
  method: "BasicAuth"
  usersFile: "conf/users.conf"
  cachingHashes {
    enabled: true
  }
}
This workaround causes that passwords are kept in the memory and it will introduce risk that someone with access to content of heap will see cached passwords.
OAuth2 security module
Generic configuration
authentication: {
  method: ${?AUTHENTICATION_METHOD} (default: "BasicAuth")
  clientSecret: ${?OAUTH2_CLIENT_SECRET}
  clientId: ${?OAUTH2_CLIENT_ID}
  authorizeUri: ${?OAUTH2_AUTHORIZE_URI}
  redirectUri: ${?OAUTH2_REDIRECT_URI}
  accessTokenUri: ${?OAUTH2_ACCESS_TOKEN_URI}
  profileUri: ${?OAUTH2_PROFILE_URI}
  profileFormat: ${?OAUTH2_PROFILE_FORMAT}
  implicitGrantEnabled: ${?OAUTH2_IMPLICIT_GRANT_ENABLED}
  jwt {
    enabled: ${?OAUTH2_JWT_ENABLED} (default: false)
    publicKey: ${?OAUTH2_JWT_AUTH_SERVER_PUBLIC_KEY}
    publicKeyFile: ${?OAUTH2_JWT_AUTH_SERVER_PUBLIC_KEY_FILE}
    certificate: ${?OAUTH2_JWT_AUTH_SERVER_CERTIFICATE}
    certificateFile: ${?OAUTH2_JWT_AUTH_SERVER_CERTIFICATE_FILE}
    idTokenNonceVerificationRequired: ${?OAUTH2_JWT_ID_TOKEN_NONCE_VERIFICATION_REQUIRED}
  }
  accessTokenParams {
    grant_type: ${?OAUTH2_GRANT_TYPE}
  }
  accessTokenRequestContentType: "application/json" (default)
  authorizeParams {
    response_type: ${?OAUTH2_RESPONSE_TYPE}
    scope: ${?OAUTH2_SCOPE}
    audience: ${?OAUTH2_AUDIENCE}
  }
  headers {
    Accept: ${?AUTHENTICATION_HEADERS_ACCEPT}
  }
  usersFile: ${?AUTHENTICATION_USERS_FILE}
}
When method is set to OAuth2, the following fields are mandatory: clientSecret, clientId, authorizeUri, redirectUri, accessTokenUri, profileUri, profileFormat, implicitGrantEnabled, usersFile.
Subconfigs accessTokenParams, accessTokenRequestContentType, authorizeParams, headers are optional and every field from any of the subconfigs is optional and could be provided separately.
By default access token request is sent using application/json content type, to use change it (eg. to application/x-www-form-urlencoded) use accessTokenRequestContentType config.
Subconfig jwt is also optional. However, if it is present and enabled is set to true, idTokenNonceVerificationRequired and one of the publicKey, publicKeyFile, certificate, certificateFile fields have to be provided.
Remarks:

Setting jwt.idTokenNonceVerificationRequired to true has an effect only if implicitGrantEnabled is also set to true.
For security reasons, if implicit flow used, implicitGrantEnabled and jwt.idTokenNonceVerificationRequired should be set to true.
Furthermore authorizeParams.response_type should be set to "access_token id_token" (not only "access_token").
Then a received access_token format has to be JWT (like id_token).
Of course, this does not apply when authorizeParams.response_type is set to code (code flow used).

Provided jwt is enabled, the backend first checks whether a user profile can be obtained from the access_token, secondly it tries to obtain the profile from a request sent to authorizeUri.

OAuth2 security module - GitHub example with code flow
Configuration in following format:
authentication: {
  method: "OAuth2"
  clientSecret: ""
  clientId: ""
  authorizeUri: "https://github.com/login/oauth/authorize"
  redirectUri: "http://localhost:3000"
  accessTokenUri: "https://github.com/login/oauth/access_token"
  profileUri: "https://api.github.com/user"
  profileFormat: "github"
  implicitGrantEnabled: false
  accessTokenParams {
    grant_type: "authorization_code"
  }
  headers {
    Accept: "application/json"
  }
  authorizeParams {
    response_type: "code"
  }
  usersFile: "./src/test/resources/oauth2-users.conf"
}
Users file in following format:
users: [ //Special settings by user email
  {
    identity: "some@email.com"
    roles: ["Admin"]
  }
]

rules: [
  {
    role: "Admin"
    isAdmin: true
  },
  {
    role: "User" //this is default role for all users
    permissions: ["Read", "Write", "Deploy"]
    categories: ["Defautl", "FraudDetection"]
  }
]
OAuth2 security module - Auth0 example with implicit flow
Auth0 application configuration

"Application Type" should be set to "Regular Web Application"
"Use Auth0 instead of the IdP to do Single Sign On" should be enabled.
"Allowed Callback URLs" should contain redirectUri.
"Implicit" should be added to "Grant Types" in "Advanced Settings".

More at https://auth0.com/docs/get-started/dashboard/application-settings.
Configuration in following format:
authentication: {
  method: "OAuth2"
  clientSecret: ""
  clientId: ""
  authorizeUri: "https://.auth0.com/authorize"
  redirectUri: "http://localhost:3000"
  accessTokenUri: "https://.auth0.com/oauth/token"
  profileUri: "https://.auth0.com/userinfo"
  profileFormat: "auth0"
  implicitGrantEnabled: true
  jwt {
    certificateFile: "./etc/cert.pem"
    idTokenNonceVerificationRequired: true
  }
  authorizeParams {
    response_type: "access_token id_token"
    scope: "openid profile email"
    audience: ""
  }
  usersFile: "./src/test/resources/oauth2-users.conf"
}
Users file in the same format as in GitHub example.
Implementation own OAuth2ServiceFactory
OAuth2 backend allows to exchange engine to fetching / parsing data from your OAuth2 Authentication Server and Profile Resource. 
By default we support Github data format. To do this, simply replace the OAuth2ServiceFactory by your own implementation. 
After that you have to register your implementation using Java's ServiceLoader mechanism by prepare META-INFO/service 
resource for pl.touk.nussknacker.ui.security.oauth2.OAuth2ServiceFactory. You can find an example at tests in 
ExampleOAuth2ServiceFactory file.
You can store passwords as plaintext or (preferably) encrypted using bcrypt. To compute encrypted password you can use following python script:
import bcrypt
print(bcrypt.hashpw("password_to_encode".encode("utf8"), bcrypt.gensalt(rounds = 12, prefix = "2a")))

Implementing own security provider
In order to implement authentication provider you have to implement trait: 
trait AuthenticatorFactory {
  def createAuthenticator(config: Config, classLoader: ClassLoader): AuthenticationDirective[LoggedUser]
}

It is based on AuthenticationDirective of Akka Http. Implementation must be put on Nussknacker classpath (Note: not in jar with model)
You must also register your implementation using Java's ServiceLoader mechanism - that is, you have to provide
file META-INF/services/pl.touk.nussknacker.ui.security.api.AuthenticatorFactory containing fully qualified name of implementation of AuthenticatorFactory.
Please note that there can be only one implementation on the classpath.

API.html.body:
Intro
Before designing processes you have to define the model. The model is made of:

data structures
services used to access external systems
event sources and sinks

Defining and discovering model
Classes of your model should be packed in a jar together with an implementation of ProcessConfigCreator. This trait defines nodes which would be used to build processes. Nussknacker accesses your model using your implementation of ProcessConfigCreator.
package pl.touk.nussknacker.engine.api.process

...

trait ProcessConfigCreator extends Serializable {

  def customStreamTransformers(config: Config): Map[String, WithCategories[CustomStreamTransformer]]

  def services(config: Config) : Map[String, WithCategories[Service]]

  def sourceFactories(config: Config): Map[String, WithCategories[SourceFactory[_]]]

  def sinkFactories(config: Config): Map[String, WithCategories[SinkFactory]]

  def listeners(config: Config): Seq[ProcessListener]

  def exceptionHandlerFactory(config: Config) : ExceptionHandlerFactory

  def expressionConfig(config: Config): ExpressionConfig

  def buildInfo(): Map[String, String]

  def signals(config: Config): Map[String, WithCategories[ProcessSignalSender]]

  def asyncExecutionContextPreparer(config: Config): Option[AsyncExecutionContextPreparer] = None

  def classExtractionSettings(config: Config): ClassExtractionSettings = ClassExtractionSettings.Default

}

Making your model jar discoverable
Nussknacker uses ServiceLoader to register your model. When you package the jar please add the file META-INF/services/pl.touk.nussknacker.engine.api.process.ProcessConfigCreator containing FQN of class implementingProcessConfigCreator interface. Exactly one implementation have to be provided. Any other case will result in throwing an exception.
Categories
Each process is assigned to exactly one category. Each node can be accessible in many categories. Category defines if a node is accessible in process. 
Creating sources and sinks
Source
To create source one needs to extend pl.touk.nussknacker.engine.api.process.SourceFactory interface and annotate single method with @MethodToInvoke and return Source[T].
Nussknacker comes with Kafka source pl.touk.nussknacker.engine.kafka.KafkaSourceFactory which uses org.apache.flink.streaming.connectors.kafka.FlinkKafkaConsumer09 underneath. 
Let's see how it works:
class KafkaSourceFactory[T: TypeInformation](config: KafkaConfig,
                                             schema: DeserializationSchema[T],
                                             val timestampAssigner: Option[TimestampAssigner[T]],
                                             ...) extends FlinkSourceFactory[T] with Serializable {
  @MethodToInvoke
  def create(processMetaData: MetaData, @ParamName("topic") topic: String): Source[T] with TestDataGenerator = {
    ...
    new KafkaSource(consumerGroupId = processMetaData.id, topic = topic)
  }
}

First let's look at constructor params. config and schema is pretty straightforward. timestampAssigner extracts event time from events, so Flink knows event time that can be used in aggregations. Event Time is Flink's crucial concept, see Event Time. 
Metadata parameter is injected by Nussknacker and topic is just a normal parameter that user can set in UI.
Source test data
To be able to test process with data from a file SourceFactory.testDataParser: Option[TestDataParser[T]] methods have to be implemented.
Source can also specify how test data is generated using Nussknacker's generate button in Test section of the right panel - see Quickstart section for details. Data generation logic is provided by extending pl.touk.nussknacker.engine.api.process.TestDataGenerator. See KafkaSourceFactory implementation for details.
Sink
Sink creation is similar to Source creation. You extend pl.touk.nussknacker.engine.api.process.SinkFactory interface and annotate single method with @MethodToInvoke and return Sink. Nussknacker comes with kafka sink pl.touk.nussknacker.engine.kafka.KafkaSinkFactory which uses org.apache.flink.streaming.connectors.kafka.FlinkKafkaProducer09 underneath. 
Creating Service
To create service you have to extend pl.touk.nussknacker.engine.api.Service interface and annotate single method with @MethodToInvoke and return scala.concurrent.Future (method name is not important). Annotated method will be invoked by Nussknacker for every element passing through this service. Service can do anything - it could be external API call or some static mapping.
Services come in two flavours - processors and enrichers. Processor does not return anything and enricher returns some value. So to be classified as Processor annotated method has to return Future[Unit] in other case service will be classified as Enricher.
Sample enricher looks like this:
class ClientService extends Service {
  @MethodToInvoke
  def invoke(@ParamName("clientId") clientId: String)
            (implicit ec: ExecutionContext, metaData: MetaData): Future[Client] = {
    val clients = Map(
      "1" -> Client("1", "Alice", "123"), 
      "2" -> Client("1", "Bob", "234") 
    )
    Future { clients.get(clientId) }
  }
}

Every non-implicit parameter should be annotated with @ParamName - value from annotation will be used in UI to display parameter name. You have full control over non-implicit parameters, on the other hand implicit parameters are injected by Nussknacker.
Apart from parameters - non-implicit and annotated with @ParamName you can also have certain implicit parameters in signature of @MethodToInvoke. They are optional - you can put any of them in a method signature, but you don't have to.
They are:

scala.concurrent.ExecutionContext - useful for e.g. invoking asynchronous external services
pl.touk.nussknacker.engine.api.MetaData - if you want to e.g. have process name passed to external services
pl.touk.nussknacker.engine.api.test.ServiceInvocationCollector - used in test mode, see next paragraph

Service in tests from file
Service in tests can behave as in production, but sometimes it seems wrong or impractical - for example when service sends mail. So Nussknacker gives you control to decide how your service behaves during tests from file.
Here's an example:
class SendMailProcessor extends Service {
  @MethodToInvoke
  def invoke(@ParamName("mailAddress") mailAddress: String)
            (implicit ex: ExecutionContext, collector: ServiceInvocationCollector): Future[Unit] = {
    Future {
      if (collector.collectorEnabled) {
        collector.collect(s"We are in test mode! Pretend to send mail to ${mailAddress}")
      } else {
        sendMail(mailAddress)
      }
    }
  }
}

SendMailProcessor uses ServiceInvocationCollector which is enabled in test mode. 
Collected value can be seen in UI in mocked service after tests, so for example you can use collector.collect() to collect HTTP request that you would normally send in production.
Lazy values (use with caution)
Instead of using Enricher node in graph to enrich data, one can use some syntactic sugar to enrich data in more object-oriented way - it is possible to inject enricher into model class. 
Here's an example.
So let's say we defined ClientService as in above, and then we passed it into ProcessConfigCreator:
class MyProcessConfigCreator extends ProcessConfigCreator {
    ...
    override def services(config: Config): Map[String, WithCategories[Service]] = {
        Map("clientService" -> all(new ClientService))
    }
    ...
}

To enrich model, which we assume is Transaction with clientId field, normally we would put Enricher in UI graph, but instead you can inject enricher:
case class Transaction(clientId: String) extends UsingLazyValues {
  lazy val client = lazyValue[Client]("clientService", "clientId" -> clientId)
}

After that you'll able to access client in expression like this #input.client - so potential HTTP call is made behind the scenes, but user cannot really distinguish it from usual field access. 
